import React from 'react'
import {I} from './Style'
export default function Headercontent() {
    return (
        <div>
            <div>
                <span>Home</span>
                <I><i class="fa fa-angle-right" aria-hidden="true"></i></I>
                <span>Invesment Overview</span>
            </div>
        </div>
    )
}
